import "./Header.css"

export const Header = () => {
  return (
    <div>
        <div id="carouselExampleSlidesOnly" class="carousel slide" data-bs-ride="carousel">
  <div class="carousel-inner">
    <div class="carousel-item active">
      <img src="../banner.jpg" class="d-block w-100" alt="..."/>
    </div>
    
  </div>
</div>
    </div>
  )
}
